export default {
  name: "InputLabel",
  props: {
    label: String,
    // 标题文本
    required: Boolean,
    // 是否必填
    border: {
      type: Boolean,
      default: true
    },
    // 是否显示边框
    borderColor: {
      type: String,
      default: $_theme.border_color_light
    },
    radius: {
      type: String,
      default: $_theme.input_radius
    },
    // 边框圆角
    minHeight: {
      type: Number,
      default: $_theme.inputHeight
    },
    // 高度数值，单位是px
    labelMinWidth: {
      type: Number,
      default: 10
    },
    // lable宽度最小数值，单位是px
    disabled: Boolean // 是否可操作

  },
  computed: {
    containerStyle: function containerStyle() {
      return {
        borderRadius: this.radius,
        minHeight: this.minHeight + 'px',
        borderColor: this.borderColor
      };
    },
    labelStyle: function labelStyle() {
      return {
        minWidth: this.labelMinWidth + 'px',
        borderRightColor: this.theme.border_color_light,
        backgroundColor: this.theme.input_label_bg_color
      };
    }
  }
};
